    true,nt"url": null,nt"notes": "<p>Theu00c2u00a0Healthcare-Associated Infections
    (HAI)u00c2u00a0measures - state data.  These measures are developed byu00c2u00a0Centers
    for Disease Control and Prevention (CDC)u00c2u00a0and collected through theu00c2u00a0National
    Healthcare Safety Network (NHSN). They provide information on infections that occur
    while the patient is in the hospital. These infections can be related to devices,
    such as central lines and urinary catheters, or spread from patient to patient after
    contact with an infected person or surface. Many healthcare associated infections
    can be prevented when the hospitals useu00c2u00a0CDC-recommended infection control
    steps.</p>n",nt"license_title": "Other License Specified",nt"extras":
